var hackService = angular.module('routerApp');

hackService.factory('hackService', ['$timeout', '$anchorScroll', '$location', '$q',

  function($timeout, $anchorScroll, $location, $q) {
    return {
      scrollAnim: scrollAnim,
      scrollToHash: scrollToHash,
      scrollToTop: scrollToTop,
      bindEscapeModalSeq: bindEscapeModalSeq,
      unbindCustomEvents: unbindCustomEvents,
      bindTabbing: bindTabbing,
      allowSecondModalFocus: allowSecondModalFocus,
      tryFocusToElem: tryFocusToElem,
      waitForElem: waitForElem
    }

    function scrollAnim(selector, noScroll, offset) {
      offset = offset || 0;
      return setTimeout(function () {
          var elem = $(selector);
          if (elem.length) {
            elem.focus();
            // Commented out to remove the scroll action of search results when deleting search log
            !noScroll ? $("html, body").animate({scrollTop: elem.offset().top - 300 + offset}, 200) : null;
          }
      }, 1);
    }

    function scrollToHash(id, yOffset) {
      yOffset = yOffset || 0;
      $anchorScroll.yOffset = yOffset;
      $location.hash(id);
      $anchorScroll();
    }

    function scrollToTop() {
      setTimeout(function () {
        $("html, body").animate({scrollTop: 0}, 200);
      }, 1);
    }

    function bindEscapeModalSeq(modal) {
      $(document).keyup(function(e) {
        // escape key is pressed
        if (e.keyCode == 27) {
          if ($('div.sweet-alert').hasClass('hideSweetAlert')) {
            $(modal).modal('hide');
          } else {
            swal.close();
          }
        }
      });

      return 'keyup';
    }

    function unbindCustomEvents(events) {
      $(document).off(events);
    }

    function bindTabbing(elemsToTab) {
      $(document).keyup(function(e) {
        // tab key is pressed
        if (e.keyCode == 9) {
          var elemToFocus = elemsToTab.shift();
          $(elemToFocus).focus();
          elemsToTab.push(elemToFocus);
          e.preventDefault();
        }
      })
      .keydown(function(e) {
        if (e.keyCode == 9) {
          e.preventDefault();
        }
      })
      .keypress(function(e) {
        if (e.keyCode == 9) {
          e.preventDefault();
        }
      });

      return 'keyup keydown keypress';
    }

    // hack to solve focus problems when sweetalert goes on top of bootstrap modal
    function allowSecondModalFocus() {
      $(document).off('focusin').on('focusin', function(e) {
        e.stopImmediatePropagation();
      });
    }

    function tryFocusToElem(selector, scrollTo) {
      waitForElem(selector).then(function(elem) {
        elem.focus();
        if (scrollTo) {
          scrollAnim(selector);
        }
      });
    }

    function waitForElem(selector) {
      var deferred = $q.defer();

      var interval = setInterval(function() {
        var elem = $(selector);
        if (elem.length) {
          clearInterval(interval);
          deferred.resolve(elem);
        }
      }, 100);

      return deferred.promise;
    }
  }
]);
(function(angular) {
  'use strict';

  angular.module('rvServices')
    .factory('imageService', imageService);

  imageService.$inject = ['$q', '$window'];

  function imageService($q, $window) {
    return {
      base64ToFile: base64ToFile,
      pdfToImgBase64: pdfToImgBase64,
      srcToBase64: srcToBase64
    };

    function base64ToFile(b64, fileName) {
      var blob = new $window.Blob(
        [jsPDF.API.binaryStringToUint8Array($window.atob(b64.split(',')[1]))],
        {type: 'image/png'}
      );
      blob.name = fileName+'.png';
      return blob;
    }

    function pdfToImgBase64(uint8Array) {
      var deferred = $q.defer();

      $window.PDFJS.getDocument(uint8Array).then(function(pdf) {
        pdf.getPage(1).then(function(page) {
          var viewport = page.getViewport(1);
          var canvas = $window.document.createElement('CANVAS');
          canvas.width = viewport.width;
          canvas.height = viewport.height;
          page.render({canvasContext: canvas.getContext('2d'), viewport: viewport}).then(function() {
            deferred.resolve(canvas.toDataURL('image/png'));
          }, function() {
            deferred.reject();
          });
        }, function() {
          deferred.reject();
        });
      }, function() {
        deferred.reject();
      });

      return deferred.promise;
    }

    function srcToBase64(src) {
      var deferred = $q.defer();
      var imgElem = angular.element($window.document.createElement('IMG')).attr('src', src);
      imgElem[0].onload = function() {
        var canvas = $window.document.createElement('CANVAS');
        canvas.width = imgElem[0].width;
        canvas.height = imgElem[0].height;
        canvas.getContext('2d').drawImage(imgElem[0], 0, 0);
        deferred.resolve(canvas.toDataURL());
      };
      imgElem[0].onerror = function() {
        deferred.reject();
      };
      return deferred.promise;
    }
  }
})(angular);
angular.module('rvServices')
  .factory('jsPDFService', jsPDFService);

jsPDFService.$inject = ['$window'];

function jsPDFService($window) {
  var doc;

  var constants = {
    BLACK: 'black',
    BOLD: 'bold',
    GOLD: 'gold',
    GRAY: 'gray',
    LARGE: 'large',
    LIGHT_GRAY: 'light_gray',
    NORMAL: 'normal',
    SMALL: 'small'
  };

  var sizes = {
    a4: {
      width: 595, // in pt
      height: 842
    },
    fontSize: {},
    indentSize: {},
    paddingSize: {},
    verticalSpacing: {}
  };
  sizes.fontSize[constants.NORMAL] = 12;
  sizes.fontSize[constants.LARGE] = 20;
  sizes.indentSize[constants.NORMAL] = 15;
  sizes.paddingSize[constants.NORMAL] = 6;
  sizes.verticalSpacing[constants.SMALL] = 15;
  sizes.verticalSpacing[constants.NORMAL] = 25;
  sizes.verticalSpacing[constants.LARGE] = 39;

  var colors = {};
  colors[constants.BLACK] = [0, 0, 0];
  colors[constants.GOLD] = [184, 159, 128];
  colors[constants.GRAY] = [136, 136, 136];
  colors[constants.LIGHT_GRAY] = [221, 221, 221];

  var startX,
    startY,
    curY,
    indentSize,
    paddingSize;

  var factory = {
    columns: columns,
    createTable: createTable,
    horizontalLine: horizontalLine,
    jsPDF: $window.jsPDF,
    newDoc: newDoc,
    newLine: newLine,
    reset: reset,
    save: save,
    text: text
  };

  return _.merge(factory, constants);

  function columns(columns) {
    var self = this;
    columns = columns || [];
    var colWidth = (sizes.a4.width-startX*2)/columns.length;
    columns.forEach(function(column, index) {
      self.text(column.text, column.writeOpts, colWidth*index+column.writeOpts.xOffset);
    });
    return self;
  }

  function createTable(columns, rows, writeOpts) {
    writeOpts = writeOpts || {};
    processWriteOpts(writeOpts);
    writeOpts = _.merge({
      theme: 'grid',
      headerStyles: {
        fontStyle: constants.BOLD,
        fillColor: colors[constants.GOLD]
      },
      bodyStyles: {
        textColor: colors[constants.GRAY]
      },
      margin: [curY, startX, 0, startX+indentSize],
      tableLineColor: colors[constants.LIGHT_GRAY]
    }, writeOpts);
    curY = doc.autoTable(columns, rows, writeOpts).autoTable.previous.finalY;
    return this;
  }

  function horizontalLine(writeOpts) {
    processWriteOpts(writeOpts).lines([[0,0], [sizes.a4.width-startX*2,0]], startX, curY);
    return this;
  }

  function newDoc() {
    reset();
    doc = new $window.jsPDF('p', 'pt');
    return this;
  }

  function newLine(verticalSpacing) {
    verticalSpacing = verticalSpacing || constants.NORMAL;
    curY += (angular.isString(verticalSpacing) ? sizes.verticalSpacing[verticalSpacing] : verticalSpacing);
    return this;
  }

  function processWriteOpts(opts) {
    opts = opts || {};
    doc.setFontSize(
      opts.size ? (angular.isString(opts.size) ? sizes.fontSize[opts.size] : opts.size) : sizes.fontSize[constants.NORMAL]
    );
    doc.setFontStyle(
      opts.style ? opts.style : constants.NORMAL
    );
    var color = colors[opts.color ? opts.color : constants.BLACK];
    doc.setTextColor(color[0], color[1], color[2]);
    indentSize = opts.indentSize ? (angular.isString(opts.indentSize) ? sizes.indentSize[opts.indentSize] : opts.indentSize) : 0;
    paddingSize = opts.paddingSize ? (angular.isString(opts.paddingSize) ? sizes.paddingSize[opts.paddingSize] : opts.paddingSize) : 0;
    return doc;
  }

  function reset() {
    startX = 29;
    startY = 43;
    curY = startY;
    indentSize = 0;
    paddingSize = 0;
  }

  function save(filename) {
    doc.save(filename);
    doc = undefined;
  }

  function text(text, writeOpts, xOffset, yOffset) {
    xOffset = xOffset || 0;
    yOffset = yOffset || 0;
    processWriteOpts(writeOpts).text(text+'', startX+indentSize+xOffset, curY+yOffset);
    return this;
  }
}
