(function() {
    'use strict';

    angular
        .module('routerApp')
        .factory('StaticDataService', StaticDataService);

    StaticDataService.$inject = [];

    function StaticDataService() {
        return {
            getListOfMonths: getListOfMonths,
            getListOfDays: getListOfDays,
            getListOfYears: getListOfYears,
            generateChildData: generateChildData,
            calculateAge: calculateAge
        }
        function getListOfMonths() {
            return ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];
        }

        function getListOfDays() {
            var days = [];
            for (var i = 1; i <= 31; i++) {
                days.push(i);
            }

            return days;
        }

        function getListOfYears(startYear) {
            var y = 1900
            if(startYear){
                y = startYear;
            }
            var today = new Date();
            var year = today.getFullYear();

            var years = [];
            for (var i = y; i <= year; i++) {
                years.push(i);
            }

            return years;
        }

        function generateChildData() {
            return {
                birth: {
                    month: 'Jan',
                    day: 1,
                    year: 1970
                },
                gender: 'Female',
                attends_daycare: 'yes',
                daycare: {
                    address: {},
                    verify: 'yes',
                    administrator: '',
                    address_is_refreshed: true,
                    selected_state: []
                },
                show_daycare_dropdown: true,
                show_daycare_fields: false
            }
        }

        function calculateAge(birthday) { // birthday is a date
            var ageDifMs = Date.now() - birthday.getTime();
            var ageDate = new Date(ageDifMs); // miliseconds from epoch
            return Math.abs(ageDate.getUTCFullYear() - 1970);
        }

    }

})();

(function() {
    'use strict';

    angular
        .module('routerApp')
        .value('storageKey', 'rv_user_da')
        .factory('storage', provideStorage);

    provideStorage.$inject = ['$exceptionHandler', '$window', 'storageKey'];

    function provideStorage($exceptionHandler, $window, storageKey) {
        // Note: this code is not mine but taken from one of the blog posts
        // of the awesome Ben Nadel
        // http://www.bennadel.com/blog/2861-encapsulating-localstorage-access-in-angularjs.htm

        //try to load the initial payload from localStorage
        var items = loadData();

        // maintain the collection of callbacks that want to hook into the
        // unload event of the in-memory cache. This will give the caling context
        // a chance to update their relevant storage items before the data
        // is persisted to localStorage
        var persistHooks = [];

        // determine if the cache data should be persisted to localStorage when
        // the application is unloaded
        var persistEnabled = true;

        // During the application lifetime, we're going to be using in-memory
        // data access (since localStorage I/O is relatively expensive and requires)
        // data to be serialized - two things we don't want the user to feel).
        // However, when the application unloads, we want to try to persist
        // the in-memory cache to localStorage
        $window.addEventListener("beforeunload", persistData);

        //return the public API
        return ({
            clear: clear,
            disablePersist: disablePersist,
            enablePersist: enablePersist,
            extractItem: extractItem,
            getItem: getItem,
            onBeforePersist: onBeforePersist,
            removeItem: removeItem,
            setItem: setItem
        });

        // public methods below

        //clear the current data cache
        function clear() {
            local_data = {};
        }

        // disable the persisting of the cache to localStorage on unload
        function disablePersist() {
            persistEnabled = false;
        }

        // enable persisting of the cache to localStorage on unload
        function enablePersist() {
            persistEnabled = true;
        }

        // remove the given key from the cache and return the value that was
        // cache with the key; returns null if the key didn't exist
        function extractItem(key) {
            var value = getItem(key);
            removeItem(key);
            return (value);
        }

        // return the item at the given key; returns null if not available
        function getItem(key) {
            key = normalizeKey(key);
            // we are using .copy() so that the internal cache can't be mutated through direct object reference
            return ((key in items) ? angular.copy(items[key]) : null);
        }

        // add the given operator to persist hooks that will be invoked prior
        // to unload-based performance
        function onBeforePersist(operator) {
            persistHooks.push(operator);
        }

        // remove the given key from the cache
        function removeItem(key) {
            key = normalizeKey(key);
            delete(items[key]);
        }

        //store the item at the given key
        function setItem(key, value) {
            key = normalizeKey(key);
            //use .copy() again
            items[key] = angular.copy(value);
        }

        //private methods below

        // attemp to load the cache fromt the localStorage interface. Once the
        // data is loaded, it is deleted from localStorage
        function loadData() {
            // there's a chance that the localStorage isn't available, even in
            // modern browsers (safari, running in private mode)
            try {
                if (storageKey in $window.localStorage) {
                    var data = $window.localStorage.getItem(storageKey);
                    //remove item from localStorage
                    $window.localStorage.removeItem(storageKey);
                    // using .extend() here as a safe-guard to ensure that the
                    // value we return is actually a hash, even if the data is
                    // corrupted
                    return (angular.extend({}, angular.fromJson(data)));
                }
            } catch (localStorageError) {
                $exceptionHandler(localStorageError);
            }

            //if code reached here, something went wrong
            return ({});
        }

        // normalize the given cache key so that we never collide with any
        // native object keys when looking up items
        function normalizeKey(key) {
            return ("storage_" + key);
        }

        // attempt to persist the cache to the localStorage
        function persistData() {
            // console.log('data is unloaded');
            // before we persist the data, invoke all the of the before-persist
            // hook operators so that consuming services have one last chance
            // to synchronize their local data with the storage data
            for (var i = 0, length = persistHooks.length; i < length; i++) {
                try {
                    persistHooks[i]();
                } catch (persistHookError) {
                    $exceptionHandler(persistHookError);
                }
            }
            // if persistence is disabled, skip the localStorage access
            if (!persistEnabled) {
                return;
            }

            // there's a chance that localStorage isn't available, even in modern
            // browsers. And, even if it does exist, we may be attempting to store
            // more data that we can based on per-domain quotas.
            try {
                $window.localStorage.setItem(storageKey, angular.toJson(items));
            } catch (localStorageError) {
                $exceptionHandler(localStorageError);
            }
        }

    }

})();
(function() {
    'use strict';

    angular
        .module('routerApp')
        .factory('SystemAlertService', SystemAlertService);

    SystemAlertService.$inject = ['AuthService', '$state', '$rootScope', 'broadcastService'];

    function SystemAlertService( AuthService, $state, $rootScope, broadcastService) {
        var status = 'STOPPED';
        var active = ['load', 'mousemove', 'mousedown', 'click', 'scroll', 'keypress'];
        var idleTimer = 30;  // in minutes
        var timer = 10000;   // in milliseconds - dev only
        var warnTimer = setTimeout(warn, (idleTimer-1)*60*1000);
        var logoutTimer = setTimeout(logout,  idleTimer*60*1000);
        var warnVisible = false;


        //var warnTimer = setTimeout(warn, timer);
        //var logoutTimer = setTimeout(logout, timer + 5000);

        var resetTimer = function() {
            if(!warnVisible) {
                //console.log("resetTimer");
                clearTimer();
                setTimer();
                if (status == "STOPPED") {
                    status = "STARTED";
                }
            }
        };

        var clearTimer = function() {
            if (warnTimer)
                clearTimeout(warnTimer);

            if (logoutTimer)
                clearTimeout(logoutTimer);
        };

        var setTimer = function() {
            //console.log("setTimer")
            warnTimer = setTimeout(warn, (idleTimer-1)*60*1000);
            logoutTimer = setTimeout(logout, idleTimer*60*1000);

            // comment out for dev testing
            warnTimer = setTimeout(warn, timer);
            logoutTimer = setTimeout(logout, timer + 30000);

            if( status == "STOPPED"){
                status = "STARTED";
            }
        };

        var warn = function() {
            var secInterval, findInterval;
            var alerts;

            console.log('AlertLoggingOutUser');

            warnVisible = true;

            broadcastService.get({type:"alert"}, function (response) {
                alerts = response;
                console.log("Alerts", alerts);

                if(alerts.length > 0)
                {
                    var latestAlert = alerts[alerts.length - 1];

                    swal({
                        title: "System Broadcast",
                        html: true,
                        //text: 'System is restarting in 30 seconds',
                        text: latestAlert.content,
                        type: 'warning',
                        confirmButtonText: "Log me out"
                        //timer: timer
                    },function(confirm){
        
                        if(confirm){
                            swal.close();
                            // resetTimer();
                            warnVisible = false;
        
                            if (findInterval)
                                clearInterval(findInterval);
        
                            if (secInterval)
                                clearInterval(secInterval);
        
                            logout();
                        }
        
                    });

                    // counts down seconds text in sweetalert
                    var start = 60;
                    var secondsText;
                    findInterval = setInterval(function() {
                        if(warnVisible) {
                            if ((secondsText = $('#warn-minute')).length) {
                                clearInterval(findInterval);
                                secInterval = setInterval(function () {
                                    if(warnVisible) {
                                        secondsText.text(--start);

                                        if (start < 0) {
                                            return 0;
                                        }

                                        console.log("Counting before logout: " + start);
                                        if (start == 0) {
                                            console.log("Inactive");
                                            logout(); // Force logout even if resetTimer() is called after 30mins of idle.
                                            return;
                                        }
                                    } else {
                                        start = 0;
                                    }
                                }, 1000);
                            }
                        } else {
                            start = 0;
                        }
                    }, 100);
                }  
            });
        };

        var logout = function() {
            // Send a logout request to the API
            console.log('System LoggingOutUser');
            swal.close();
            destroyTimer(); // Cleanup
            warnVisible = false;

            AuthService.logout();
            $rootScope.$broadcast('user-logged-out');
            localStorage.removeItem('userId');
            $state.go('home');
        };

        var destroyTimer = function() {
            clearTimer();

            for (var i in active) {
                window.removeEventListener(active[i], resetTimer);
            }

            if( status == "STARTED"){
                status = "STOPPED";
            }
        };

        var start = function (){
            console.log("SystemAlertService.started");

            // for (var i in active) {
            //     window.addEventListener(active[i], resetTimer);
            // }

            clearTimer();
            setTimer();
        };

        var stop = function(){
            console.log("SystemAlertService.stopped");
            destroyTimer();

        };

        var getStatus = function(){
            console.log("SystemAlertServiceStatus: "+status);
            return status;
            //destroyTimer();
        };

        var isStarted = function(){
            return status == "STARTED";
            //destroyTimer();
        };
        

        
        return {start:start,
                stop : stop,
                setTimer: setTimer,
                resetTimer: resetTimer,
                getStatus:getStatus,
                isStarted:isStarted
                };

    }
})();
angular.module('rvServices')
  .factory('timeService', timeService);

timeService.$inject = [];

function timeService() {
  return {
    getHours: getHours,
    getMinutes: getMinutes,
    getPeriods: getPeriods
  };

  function buildNumArr(min, max, prependZero) {
    var arr = [];
    while (min <= max) {
      var numStr = min.toString();
      if (prependZero && numStr.length < 2) {
        numStr = '0' + numStr;
      }
      arr.push(numStr);
      min++;
    }
    return arr;
  }
  
  function getHours() {
    return buildNumArr(1, 12);
  }

  function getMinutes() {
    return buildNumArr(0, 59, true);
  }

  function getPeriods() {
    return ['AM', 'PM'];
  }
}
